"use client";
import React, { useEffect, useState } from "react";
import CardDataStats from "../CardDataStats";
import API from "@/services/services";
import store from "@/redux/store";

const Dashboard: React.FC = () => {

  const Auth = store.getState().Auth?.auth
  console.log(Auth)

  const [dataUser, setDataUser] = useState<any>(null)
  const [dataTour, setDataTour] = useState<any>(null)
  const [dataArticel, setDataArticel] = useState<any>(null)
  const [dataIsland, setDataIsland] = useState<any>(null)

  useEffect(() => {
    (async () => {
      const responseUser = await API.getAllAccount()
      setDataUser(responseUser?.data?.data)

      const responseArticle = await API.getAllArticle()
      setDataArticel(responseArticle?.data?.data)

      const responseTour = await API.getAllTour()
      setDataTour(responseTour?.data?.data)

      const responseIsland = await API.getAllIsland()
      setDataIsland(responseIsland?.data?.data)
    })()
  }, [])

  return (
    <>
      <div className="w-[100%] md:mb-2 h-max items-center bg-white p-6 md:px-7 md:py-12 shadow-md">
        <h2 className="text-[28px] flex text-black">Selamat datang <b className='hidden ml-[10px] md:flex'>{Auth?.username}</b> ðŸ‘‹</h2>
      </div>

      <div className="grid grid-cols-1 gap-4 md:grid-cols-2 md:gap-6 xl:grid-cols-4 2xl:gap-7.5">
        <CardDataStats title="Jumlah Artikel" total={dataArticel?.length}>
          <img className="w-[50%]" src={'data:image/png;base64,'} alt="jumlah artikel" />
        </CardDataStats>

        <CardDataStats title="Jumlah Lokasi Wisata" total={dataTour?.length}>
          <img className="w-[64%]" src={'data:image/png;base64,'} alt="jumlah lokasi wisata" />
        </CardDataStats>

        <CardDataStats title="Jumlah super-admin" total={dataIsland?.length}>
          <img className="w-[50%]" src={'data:image/png;base64,'} alt="jumlah-super-admin" />
        </CardDataStats>

        <CardDataStats title="Jumlah super-sub-admin" total={dataUser?.filter((data: any) => data?.role === 'super-sub-admin')?.length}>
          <img className="w-[50%]" src={'data:image/png;base64,'} alt="jumlah-super-admin" />
        </CardDataStats>
      </div>

    </>
  );
};

export default Dashboard;
